import './App.css';
import Intro from './Intro';
import Brands from './Brands.js'

import './App.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import NewArrivals from './NewArrivals.js'

function App() {
  return (
    <Router>
      <Intro></Intro>
      <Brands></Brands>

      <Routes>
        <Route path="/catalog" element={<h2>Catalog Page</h2>} />
      </Routes>
    </Router>

  );
}

export default App;
